import Toolbar from "./toolbar";

const Preview = (props) =>
{
    return (
        <div id="preview" className={props.class}> 
            <Toolbar title="Preview"/>
            <div dangerouslySetInnerHTML={{__html: marked(props.markdown)}}/>
        </div>
    );
}

export default Preview;
